import React, { useState } from "react";
import "./admin.css";

const UserNavbar = ({ name, role, profilePhoto }) => {
  const [isOpen, setIsOpen] = useState(false);

  const defaultAvatar =
    "https://cdn-icons-png.flaticon.com/512/847/847969.png"; // fallback icon

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="user-navbar">
      <button
        className="user-info"
        onClick={toggleDropdown}
        aria-haspopup="true"
        aria-expanded={isOpen}
        tabIndex={0}
        style={{
          background: "none",
          border: "none",
          padding: 0,
          cursor: "pointer",
        }}
      >
        <img
          src={profilePhoto || defaultAvatar}
          alt="Profile"
          className="profile-avatar"
        />
        <div className="user-details">
          <span className="user-name">{name}</span>
          <span className="user-role">{role}</span>
        </div>
        <span className="arrow">{isOpen ? "▲" : "▼"}</span>
      </button>

      {isOpen && (
        <ul className="dropdown-menu">
          <li>
            <button className="dropdown-item">Write a review</button>
          </li>
          <li>
            <button className="dropdown-item">Profile</button>
          </li>
          <li>
            <button className="dropdown-item">Bookings</button>
          </li>
          <li>
            <button className="dropdown-item">Messages</button>
          </li>
          <li>
            <button className="dropdown-item">Account info</button>
          </li>
          <li>
            <button className="dropdown-item">Sign out</button>
          </li>
        </ul>
      )}
    </nav>
  );
};

export default UserNavbar;
